import React, {Component} from "react"


export default class DisplayData extends Component{
    constructor(props){
        super(props)
    }
    render(){
        //let data = this.props.data
        return(
            <div>
                {this.props.data.map(x => {
                    return <p>{x.id, x.name}</p>
                })}
            </div>
        )
    }
}
